import fire from '../fire'
import { Redirect, Router, Link } from 'react-router-dom'
import { AuthContext } from "../helpers/auth";

const Nav = () => {

    const handleLogout = () => {
        fire.auth().signOut();
    };

    return (
        <Router>
            <nav>
                <ul className="nav-links">
                    <li>Datasets</li>
                    <li>Home</li>
                </ul>
                <button onClick={handleLogout}>Sign out</button>
            </nav>
        </Router>
    )

}

export default Nav
